        restart();
        set_object_positionC(172);
        set_object_positionC(173);
        marker[107]=true;
        marker[109]=true;
        marker[111]=true;
        set_object_position(506,76);
        set_object_positionC(502);
        counter[1]=4;
        jump(76);
        return;
