    // IF ROOMGT 61 AND ROOMLT 66 AND VERB 70 AND NOUN 168 THEN MESS 646 WAIT ENDIF Examine channel/water
    if(current_position>61) if(current_position<66) if(cvn70(168)) {
        show_message(message646);
        return;
    }

    // IF VERB 244 AND NOUN 507 AND AVAI 507 THEN MESS 632 WAIT ENDIF Ignite stick
    if(cvna(244,507,507)) {
        show_message(message632);
        return;
    }

    // IF VERB 66 AND NO1EQ 164 AND NO2EQ 507 AND AVAI 507 THEN MESS 632 WAIT ENDIF Set fire to stick.
